const WidgetTags = () => {

  const tags=['c','c++','css','Express','']
  return (
    <div className='widget-tags'>
      <h4>Watched tags</h4>
      <div className='widget-tags-div'>
        {
          tags.map
        }
      </div>
      
    </div>
  )
}

export default WidgetTags
